contracts/Helpers.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity ^0.8.24;

library Helpers {
    function stringToInt8(string memory _str) public pure returns (int8) {
        // Convert string to integer
        int256 intValue = parseInt(_str);

        // Check if the value fits into int8 range
        require(intValue >= -128 && intValue <= 127, "Value out of range for int8");

        // Narrowing the integer down to int8
        int8 intValue8 = int8(intValue);

        return intValue8;
    }

    // Helper function to parse string to integer
    function parseInt(string memory _str) internal pure returns (int256) {
        bytes memory b = bytes(_str);
        uint256 result = 0;
        bool isNegative = false;
        for (uint256 i = 0; i < b.length; i++) {
            if (i == 0 && b[i] == bytes1("-")) {
                isNegative = true;
            } else {
                result = result * 10 + uint256(uint8(b[i])) - 48; // 48 is the ASCII value of '0'
            }
        }
        if (isNegative) {
            return -int256(result);
        } else {
            return int256(result);
        }
    }
}

